    false,nt"url": null,nt"notes": "This narrative report for Lower Souris
    National Wildlife Refuge outlines Refuge accomplishments from September to December
    1947. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing and haying. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses and violations. N-R forms and photographs are attached.",nt"owner_org":
